import sys


def f1(f1_p1: str) -> str:
    f1_v1 = len(f1_p1) // 2
    f1_v2 = '('.join(f1_p1[:f1_v1])
    f1_v3 = ')'.join(f1_p1[f1_v1:])
    if len(f1_p1) % 2 != 0:
        f1_v2 += '('
    return f'{f1_v2}{f1_v3}'


if __name__ == '__main__':
    print(f1(sys.argv[1]))
